import React, { InputHTMLAttributes } from 'react'

interface ButtonProps{
    text: string;
    
}

const Button: React.FC<ButtonProps> =({text,...rest}) =>{
    return(
        <div >
           <button>{text}</button>
        </div>
    );
}
export default Button;
